import React from "react";
import PropTypes from "prop-types";
import AppLayout from "../components/AppLayout";

const signup = () => {
  return (
    <>
      <Head>
        <title>회원가입 | sns</title>
      </Head>
      <AppLayout></AppLayout>
    </>
  );
};

signup.propTypes = {};

export default signup;
